import React from 'react'
import {

    Card,
    CardHeader,
    CardBody,
    Button,
    Col,
    CardFooter,
    Pagination,
    PaginationItem,
    PaginationLink,
    Table,
    Container,
    Row,
    // Dropdown,
} from "reactstrap";
import DatePicker from "react-datepicker";
import { useState } from "react";
import "react-datepicker/dist/react-datepicker.css";
import Dropdown from "views/examples/Dropdown";
import Dropdown2 from "views/examples/Dropdown2";


import { useEffect } from 'react';

var index = 0;
var page = 0;
var numOfRows = 10;

/**
 * 
 * @param {String dateString} 
 * @returns Formated Date as YYYY-MM-DD
 */
function formatDate(dateString) {
    let date = new Date(dateString);
    var year = date.getFullYear();
    var month = date.getMonth() + 1;
    var day = date.getDate();
    if (day < 10) {
        day = 0 + "" + day;
    }
    if (month < 10) {
        month = 0 + "" + month;
    }
    return year + '-' + month + '-' + day;

}


export default function AEPS() {
    const getInitialState = () => {
        const value = "Dropdown";
        return value;
      };
    
      const [value, setValue] = useState(getInitialState);
    //   const [userlist, setUserlist] = useState([]);
    
      const handleChange = (e) => {
        setValue(e.target.value);
        
      };
    
      const [todos, setTodos] = useState([
        {
          text: "delectus aut autem",
          isCompleted: false
        },
        {
          text: "quis ut nam facilis et officia qui",
          isCompleted: false
        },
        {
          text: "laboriosam mollitia et enim quasi adipisci quia provident illum",
          isCompleted: false
        }
      ]);
    
      const addTodo = text => {
        const newTodos = [...todos, { text }];
        setTodos(newTodos);
      };
    
      const completeTodo = index => {
        const newTodos = [...todos];
        newTodos[index].isCompleted = true;
        setTodos(newTodos);
      };
    
      const removeTodo = index => {
        const newTodos = [...todos];
        newTodos.splice(index, 1);
        setTodos(newTodos);
      };
    
      const [username, setUsername] = useState("");
      const [password, setPassword] = useState("");
    
      function validateForm() {
        return username.length > 0 && password.length > 0;
      }
    
      function handleSubmit(event) {
        event.preventDefault();
      }
    
    


    const [sdate, setsDate] = useState();
    const [edate, seteDate] = useState();
    const [isLoading, setIsLoading] = useState(false);
    const [resMap, setResponse] = useState([]);
    const [count, setCount] = useState(0);
    const [query, setQuery] = useState('')
    const [userlist, setUserlist] = useState([]);


    
    console.log(resMap.filter(row=>row.narration.toLowerCase().includes("")))
    setUserlist([
        {
            "roleId": 4,
            "userName": "O6T9L0",
            "name": "TEST SUPER DB",
            "mobile": "SUPERTEST"
        }
    ])

    //console.log(filter(query, 0 , resMap))

    
   

// const handleChange = (e) => {
//     setquery(e.target.value)
// }

    const handlstartdate = (e) => {
        console.log(formatDate(e));
        setsDate(e);
    }
    const handlenddate = (e) => {
        seteDate(e);
    }
   
   

    const handelNext = (e) => {
        page += 1;
        setCount(page)
        var token = localStorage.getItem("token");
        if (token !== null || token !== undefined) {
            const myHeaders = new Headers()
            myHeaders.append("Authorization",
                "Bearer " + localStorage.getItem("token"))
            myHeaders.append("Content-Type", "application/json")
            console.log(formatDate(sdate), formatDate(edate));
            var raw = JSON.stringify({
                "endDate": formatDate(edate),
                "startDate": formatDate(sdate),
                "userId": ""
            })
            var requestOptions = {
                method: "POST",
                headers: myHeaders,
                body: raw,
                redirect: "follow",
            };
            let transactionUrl = "https://uat.softmintdigital.com/reportservice/transaction/aepsreport?pageNo=" + page + "&pageSize=" + numOfRows;
            
            fetch(transactionUrl,
                requestOptions
            )
                .then((response) => response.json())
                .then((result) => {
                    index = 0;
                    setResponse(result.report)
                    setIsLoading(false);
                    console.log(transactionUrl);

                })

                .catch((error) => console.log(error));

        }
    }
    const handlePrevious = () => {
        if (page <= 0) {
            page = 0
        } else {
            page -= 1
        }
        setCount(page)

        var token = localStorage.getItem("token");
        if (token !== null || token !== undefined) {
            const myHeaders = new Headers()
            myHeaders.append("Authorization",
                "Bearer " + localStorage.getItem("token"))
            myHeaders.append("Content-Type", "application/json")
            console.log(formatDate(sdate), formatDate(edate));
            var raw = JSON.stringify({
                endDate: formatDate(edate),
                startDate: formatDate(sdate),
                userId: ""
            })
            var requestOptions = {
                method: "POST",
                headers: myHeaders,
                body: raw,
                redirect: "follow",
            };
            let transactionUrl = "https://uat.softmintdigital.com/reportservice/transaction/aepsreport?pageNo=" + page + "&pageSize=" + numOfRows;
            
            fetch(transactionUrl,
                requestOptions
            )
                .then((response) => response.json())
                .then((result) => {
                    index = 0;
                    setResponse(result.report)
                    setIsLoading(false);
                    console.log(result.report);

                })

                .catch((error) => console.log(error));

        }

    }

    const handleApi = () => {
        setIsLoading(true);
        var token = localStorage.getItem("token");
        if (token !== null || token !== undefined) {
            const myHeaders = new Headers()
            myHeaders.append("Authorization",
                "Bearer " + localStorage.getItem("token"))
            myHeaders.append("Content-Type", "application/json")
            console.log(formatDate(sdate), formatDate(edate));
            var raw = JSON.stringify({
                endDate: formatDate(edate),
                startDate: formatDate(sdate),
                userId: ""
            })
            var requestOptions = {
                method: "POST",
                headers: myHeaders,
                body: raw,
                redirect: "follow",
            };
            let transactionUrl = "https://uat.softmintdigital.com/reportservice/transaction/aepsreport?pageNo=" + page + "&pageSize=" + numOfRows;
            
            fetch(transactionUrl,
                requestOptions
            )
                .then((response) => response.json())
                .then((result) => {
                    index = 0;
                    setResponse(result.report)
                    console.log(result.report)
                    setIsLoading(false);


                })

                .catch((error) => console.log(error));

        } else {
            this.props.history.push("/auth/login")
        }
    }
    if (isLoading) return 'loading';



    return (
        <>

            <div className="header bg-gradient-info pb-8 pt-5 pt-md-8">
           <Container fluid>
                    <div className="header-body">
                        <Row>
                        <Col lg="12" xl="12">
                                <Card className="card-stats mb-4 mb-xl-0">
                                    <CardBody>
                                        <Row>
                                            <Col lg="2" md="6">
                                                <h4>Start Date: </h4>
                                               
                                                <DatePicker className="form-control" selected={sdate} onChange={handlstartdate} placeholderText="Select Date" showPopperArrow={false} dateFormat="yyyy-MM-dd" id='dates' />
                                               

                                            </Col>
                                            <Col lg="2" md="6">
                                                <h4>End Date: </h4>
                                                <DatePicker className="form-control" selected={edate} dateFormat="yyyy-MM-dd" placeholderText="Select Date" showPopperArrow={false} onChange={handlenddate} id='datee' />

                                               
                                            </Col>
                                            
                                            
                                           



                                            <Col lg="2" md="6">
                                                <h4>Search</h4>
                                                <div>

                                                    <input
                                                        type="text"
                                                        // value={query} 
                                                        onChange={(e)=>setQuery(e.target.value)}
                                                        className="form-control"
                                                        placeholder="Search"
                                                        style={{marginBottom: "2px",}}
                                                    ></input>
                                                </div>
                                            </Col>
                                            <Col lg="2" md="6">
                                                <button type="submit" className="btn btn-success"
                                                    style={{
                                                        backgroundColor: "#11cdef",
                                                       
                                                        textAlign: "center",
                                                        display: "flex",
                                                        justifyContent: "center",
                                                        alignItems: "center",
                                                        marginTop: "30px",
                                                    }}
                                                    onClick={handleApi}
                                                   
                                                    data-clipboard-text="align-center"
                                                    id="tooltip662352101"
                                              
                                                >
                                                    UPDATE
                                                </button>
                                            </Col>
                                            <Col lg="2" md="6">
                                                <button type="submit" className="btn btn-success"
                                                    style={{
                                                        backgroundColor: "#11cdef",
                                                       
                                                        textAlign: "center",
                                                        display: "flex",
                                                        justifyContent: "center",
                                                        alignItems: "center",
                                                        marginTop: "30px",
                                                    }}
                                                    
                                                    data-clipboard-text="align-center"
                                                    id="tooltip662352101"
                                              
                                                >
                                                    Export
                                                </button>
                                            </Col>
                                            <Col lg="2" md="6">
                                                <button type="submit" className="btn btn-success"
                                                    style={{
                                                        backgroundColor: "#11cdef",
                                                      
                                                        textAlign: "center",
                                                        display: "flex",
                                                        justifyContent: "center",
                                                        alignItems: "center",
                                                        marginTop: "30px",
                                                    }}
                                                   
                                                    data-clipboard-text="align-center"
                                                    id="tooltip662352101"
                                               
                                                >
                                                    Export
                                                </button>
                                            </Col>
                                           
                                            <Router>
      

        <div className="pages">
          <Switch>
           
              <div className="home">
                <select value={value} onChange={handleChange}>
                  <option>RoleId</option>
                  <option value="RoleId 1">RoleId 1</option>
                  <option value="RoleId 2">RoleId 2</option>
                  <option value="RoleId 3">RoleId 3</option>
                  <option value="RoleId 3">RoleId 4</option>
                  <option value="RoleId 3">RoleId 5</option>
                  <option value="RoleId 3">RoleId 6</option>
                </select>
                {/* <p>{`You selected ${value}`}</p> */}
              </div> 
              {/* </Route> */}
            {/* <Route path="/Task" component={Task}> */}
              <div className="todo-list">
                {todos.map((todo, index) => (
                  <Todo
                    key={index}
                    index={index}
                    todo={todo}
                    completeTodo={completeTodo}
                    removeTodo={removeTodo}
                  />
                ))}
                <p>{`Add Task & Enter`}</p>
                <TodoForm addTodo={addTodo} />
              </div>
            {/* </Route> */}
            {/* <Route path="/User" component={User}> */}
              <div className="Login">
                <Form onSubmit={handleSubmit}>
                  <Form.Group size="lg" controlId="username">
                    <Form.Label>Username</Form.Label>
                    <Form.Control
                      autoFocus
                      type="string"
                      value={username}
                      onChange={(e) => setUsername(e.target.value)}
                    />
                  </Form.Group>
                  <Form.Group size="lg" controlId="password">
                    <Form.Label>Password</Form.Label>
                    <Form.Control
                      type="password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                    />
                  </Form.Group>
                  <Button block size="lg" type="submit" disabled={!validateForm()}>
                    Login
                  </Button>
                  <Button block size="lg" type="submit" disabled={!validateForm()}>
                    Reset Password
                  </Button>
                </Form>
              </div>
            {/* </Route> */}
            {/* <Route path="/Contact" component={Contact} /> */}
          </Switch>
        </div>


      </Router>
                                            <Dropdown2 />

                                            
                                        </Row>
